const EditButton = (props) => {
  const { label = "LABEL", onClick, alignment = "flex-end" } = props;

  return (
    <div style={{ display: "flex", justifyContent: alignment, width: "100%" }}>
      <div
        style={{
          display: "inline-flex",
          alignItems: "center",
          justifyContent: "center",
          gap: "8px",
          padding: "8px 16px",
          background: "#FFFFFF",
          color: "rgba(244, 119, 56, 1)",
          borderRadius: "4px",
          cursor: "pointer",
          fontFamily: "Roboto, sans-serif",
          fontWeight: 400,
          fontSize: "16px",
          lineHeight: "100%",
          textTransform: "capitalize",
          border: "none",
        }}
        className="digit-search-action"
        onClick={onClick}
      >
        <EditIcon />
        <span className="digit-search-text">{label}</span>
      </div>
    </div>
  );
};


